import React from "react";
import styled from "styled-components";
import { AiOutlineCamera } from "react-icons/ai"; 

const HeaderEach = styled.div`
  width: 100%;
  height: 56px;
  margin : 0px;
  background-color: #323232;
  display : flex;
  align-items: center;
  justify-content: center;
`;

// padding-left : 16px;
// padding-right : 16px;
// padding-top : 8px;
// padding-bottom : 8px;

const HeaderText = styled.p`
  font-size: 30px;
  font-weight: 500;
  color : white;
`;

const HeaderLogo = styled.div`
    font-size : 30px;
    color:white;
`

const Header = (props) => {
  return (
    <>
      <HeaderEach>
        <AiOutlineCamera color="white" width="30px"/><HeaderText>{props.text}</HeaderText>
      </HeaderEach>
    </>
  );
};

export default Header;
